import './App.css';
import Header from "./compoments/header/Header";
import Techs from "./compoments/techs/Techs";
import Referances from "./compoments/referances/Referances";
import Info from "./compoments/info/Info";


function App() {
  return (
    <div className="App">
      <Header/>
      <Info/>
        <Techs/>
        <Referances/>
    </div>
  );
}

export default App;
